import React from "react";
import styled from "styled-components";

export const Cell = (props) => {
  return (
    <StyledDiv>
      {props.value > 0 ? <h1>{props.value}</h1> : <h2>empty</h2>}
    </StyledDiv>
  );
};

Cell.defaultProps = {
  value: -1,
  note1: 0,
  note2: 0,
  note3: 0,
  note4: 0,
  note5: 0,
  note6: 0,
  note7: 0,
  note8: 0,
  note9: 0,
};

const StyledDiv = styled.div`
  height: 5em;
  width: 5em;
  border: 1px solid black;
  align-content: center;
`;
